import { Component, OnInit } from '@angular/core';
import { Userstory } from '../userstory';

@Component({
  selector: 'app-userstory',
  templateUrl: './userstory.component.html',
  styleUrls: ['./userstory.component.css']
})
export class UserstoryComponent {
  userstories: Userstory[];

  constructor() {}

  ngOnInit(): void {
    this.userstories = [
      {
        "epicId": 101,
        "title": "Agile Management Team",
        "userStoryDetails": "about new intern management portal",
        "acceptanceCriteria": "Rishav Chaudhary",
        "priority" : "Top",
        "createdOn": "2023-01-03",
        "doneOn": "2023-05-03",
        "assignedToDeveloperId" : 2262958,
        "storyPoints": "Testing and developement is yet to be completed.",
        "status": "New"
      },
      {
        "epicId": 101,
        "title": "Agile Management Team",
        "userStoryDetails": "about new intern management portal",
        "acceptanceCriteria": "Rishav Chaudhary",
        "priority" : "Top",
        "createdOn": "2023-01-03",
        "doneOn": "2023-05-03",
        "assignedToDeveloperId" : 2262958,
        "storyPoints": "Testing and developement is completed but coding is remaining.",
        "status": "Coding"
      }
    ];
  }
}
